import Layout from "../components/Layout"
import Head from "next/head"

class HomePage extends React.Component{
  constructor(props){
    super(props)
  }

  render(){
    return (
      <Layout style={{ textAlign: 'center' }}>
        <Head></Head>
        <h1>JDanielS</h1>
        <p>Professional Idiot</p>
      </Layout>
    )
  }
}

export default HomePage
